        for i in range(n - L + 1):
            j = i + L - 1
            dp[i][j] = float('inf')
            for r in range(i, j + 1):
                c = dp[i][r - 1] if r > i else 0
                c += dp[r + 1][j] if r < j else 0
                c += sum(freq[i:j + 1])
                if c < dp[i][j]:
                    dp[i][j] = c
    return dp[0][n - 1]

